import React from "react";
//import PropTypes from "prop-types";

const Edit = props => {
  return (
    <div>
      <p>Edit student name</p>
      <p>Old name: {props.student.name}</p>
      <form onSubmit={props.onEditStudentName}>
        <input
          type="text"
          name="name"
          value={props.name}
          onChange={props.onChangeName}
        />
        <input type="submit" value="submit" />
      </form>
      <button onClick={props.returnToList}>Cancel</button>
    </div>
  );
};

export default Edit;
